function create_area_options(da, v) {
    var option_html = "";
    for(var k in da){
        option_html +="<option";
        if (v == k) {
            option_html +=" selected ";
        }
        option_html +=" value='"+da[k]['id']+"'>"+da[k]['name']+"</option>"
    }
    return option_html;
}

function state_change (elh){
    var el = $(elh);
    var pp = el.parent();
    var state = pp.find('.state').val();
    pp.find(".city").html('<option value="0">选择城市</option>' + create_area_options(address_area[state]['child']));
    pp.find(".area").html('<option value="0">选择区域</option>');
}

function city_change (elh){
    var el = $(elh);
    var pp = el.parent();
    var city = pp.find(".city").val();
    var state = pp.find(".state").val();
    pp.find(".area").html('<option value="0">选择区域</option>' + create_area_options(address_area[state]['child'][city]['child']));
}

function init_area(el,data){
    el.find('.state').html('<option value="0">选择省份</option>' + create_area_options(address_area, data[0]));

    var city_address = {};
    if (data[0] && address_area[data[0]]) {
        city_address = address_area[data[0]]['child'];
    }
    el.find('.city').html('<option value="0">选择城市</option>' + create_area_options(city_address, data[1]?data[1]:0));

    var area_address =  {};
    if (data[1] && city_address[data[1]]) {
        area_address = city_address[data[1]]['child'];
    }
    el.find('.area').html('<option value="0">选择区域</option>' + create_area_options(area_address, data[2]?data[2]:0));
}

function format_area(address) {
    var area = "";;
    if (address && $.isArray(address) && address.length == 4){
        var state = address_area[address[0]];
        if (state) {
            area += state.name;
            var city = state['child'][address[1]];
            if (city) {
                area += city.name;
                var addr = city['child'][address[2]];
                if (addr) {
                    area += addr.name + address[3];
                }
            }
        }
    }
    return area;

}